import React, { Component } from "react";

import ProductsGrid from "../common/ProductsGrid";

class Memory extends Component {
  state = {};
  render() {
    return (
      <div className="row">
        <div className="col-2">
          <ProductsGrid />
        </div>
      </div>
    );
  }
}

export default Memory;
